local BlockPlayer = require "actions/BlockPlayer"
local Do = require "actions/Do"
local Ease = require "actions/Ease"
local Parallel = require "actions/Parallel"

return function(self, player)
    if self.hit then
        return
    end
    self.hit = true
    player.basicUpdate = function() end
    player.sprite:setAnimation("walkright")
    self.scene:changeScene{map="ironlock_snively", fadeInSpeed = 0.5, fadeOutSpeed = 0.1, fadeOutMusic = true}
    self:run(BlockPlayer {
        Parallel {
            Ease(player, "x", 8400, 1, "linear"),
            Ease(player.dropShadow, "x", 8400, 1, "linear")
        }
    })
end
